from typing import List

def rmsnorm_part2(input: List[int], weight: List[int], ss: int) -> List[int]:
    return vec_elemwise_mul(
        vec_elemwise_mul(
            vec_scalar_mul(
                1 // integer_sqrt(ss // len(input) + 1), 
                input
            ), 
            weight
        )
    )

def integer_sqrt(x: int) -> int:
    return x
